import Icon from '../../atoms/Icon'

const Cart = (props)=> {
    const {num} = props;
    
    return(

        <div className="cart" >

           <Icon classText='bx bx-cart'/>
           <div className="cart-entry" >{num}</div>
        </div>

    )
}

export default Cart;
